"use strict";var simpleDate=function(t){this.date=t};simpleDate.prototype.getYear=function(){var t=this.date,e=(t.getYear()+1900).toString();return e},simpleDate.prototype.getMonth=function(){var t,e=this.date,r=e.getMonth();if(10>r+1){var a=String(r+1);t="0"+a}else t=String(e.getMonth()+1);return t},simpleDate.prototype.getDay=function(){var t,e=this.date,r=e.getDate();if(10>r){var a=r.toString();t="0"+a}else t=e.getDate().toString();return t},simpleDate.prototype.getYYMMDD=function(){var t=this.date,e=new simpleDate(t);return e.getYear()+"-"+e.getMonth()+"-"+e.getDay()};
